Since we don't want an enum with 2347 elements, we have to revert to a type that can hold this many elements. The smallest integer type large enough provided by Rust is u16. Let's define F a "newtype" : a struct with one u16 field v. Notice the refinment annotation on v: the extraction of this type F via hax will result in a type enforcing v small enough. pub const Q: u16 = 2347; #[hax::attributes]
pub struct F { #[refine(v < Q)] pub v: u16,
} let v_Q: u16 = 2347us type t_F = { f_v:f_v: u16{f_v <. v_Q} } In Rust, we can now define functions that operates on type F, assuming they are in bounds with respect to Fâ‚‚â‚ƒâ‚„â‚‡: every such assumption will be checked and enforced by the proof assistant. As an example, below is the implementation of the addition for type F. use core::ops::Add; impl Add for F { type Output = Self; fn add(self, rhs: Self) -> Self { Self { v: (self.v + rhs.v) % Q, } }
} [@@ FStar.Tactics.Typeclasses.tcinstance]
let impl: Core.Ops.Arith.t_Add t_F t_F = { f_Output = t_F; f_add_pre = (fun (self: t_F) (rhs: t_F) -> true); f_add_post = (fun (self: t_F) (rhs: t_F) (out: t_F) -> true); f_add = fun (self: t_F) (rhs: t_F) -> { f_v = (self.f_v +! rhs.f_v <: u16) %! v_Q } <: t_F } Here, F* is able to prove automatically that (1) the addition doesn't overflow and (2) that the invariant of F is preserved. The definition of type F in F* (named t_F) very explicitely requires the invariant as a refinement on v.

